INSERT INTO `genero` VALUES (1,'Lucha','se basa en manejar un personaje peleador, cuyo objetivo es derrotar al oponente.'),(3,'Aventura','caracterizados por la investigación, exploración, la solución de rompecabezas, la interacción con personajes.'),(4,'Plataformas','el jugador tiene que saltar sobre plataformas suspendidas o a lo largo de obstáculos y enemigos hasta llegar a una meta.'),(6,'Estrategia','requieren que el jugador ponga en práctica sus habilidades de planeamiento y pensamiento para conseguir la victoria.'),(7,'Simulación','pretende imitar con mayor o menor fidelidad una actividad o situación de la vida real'),(9,'Deportivo','simulan deportes. Permiten al jugador controlar a uno o más atletas durante el transcurso de una competencia.'),(11,'Shooter','permitir controlar un personaje que, por norma general, dispone de un arma que puede ser disparada a voluntad');
